/** @format */

import React, { Fragment } from "react";
import { Grid, Box } from "@mui/material";

const LedgerDoc = () => {
  return (
    <Fragment>
      <Grid container spacing={1}>
        <Grid item xs={4} sx={{}}>
          <Box
            sx={{
              height: "100%",
              width: "100%",
              backgroundColor: "darkGray",
              borderRadius: "2rem",
            }}
          >
            MS Word Document On Pleading or Non Pleading Paper
          </Box>
        </Grid>
        <Grid item xs={4}>
          <Box
            sx={{
              height: "100%",
              width: "100%",
              backgroundColor: "darkGray",
              borderRadius: "2rem",
            }}
          >
            Space for 2nd Document to be opend if user wants it
          </Box>
        </Grid>
        <Grid item xs={4}>
          <Box
            sx={{
              height: "100%",
              width: "100%",
              backgroundColor: "darkGray",
              borderRadius: "2rem",
            }}
          >
            something
          </Box>
        </Grid>
      </Grid>
    </Fragment>
  );
};

export default LedgerDoc;
